import './index.scss';
import {Animator, batch, Fade, FadeOut, MoveOut, ScrollContainer, ScrollPage, Sticky, Zoom} from 'react-scroll-motion';

function SkillsCertificates(){
  return (
    <html>
      <body>
    <ScrollContainer>
      <ScrollPage page = {0}>
        <Animator animation = {batch(Sticky(), Fade(), MoveOut)}>
          <h2>Let me show you a scroll animation</h2>
        </Animator>
      </ScrollPage>
      <ScrollPage page = {1}>
        <Animator animation = {Zoom()}>
          <h4>I'm Fade Up Scroll Out !</h4>
        </Animator>
      </ScrollPage>
    </ScrollContainer>
    </body>
    </html>
  );

}
export default SkillsCertificates;
